/// <summary>
/// Добавить новые туры
/// </summary>
/// <param name="periodicity">Справочное поле "Периодичность"</param>
public virtual void AddNewTours(Guid periodicity)
{
	var recordsToCreate = Get<int>("InsertRecordCount");
	var tourState = Get<Guid>("TravelTouState");
	var tourId = Get<Guid>("SelectedTourId");
	var startDate = DateTime.Now;

	for(int i = 0; i< recordsToCreate; i++)
	{
		SaveNewTour(tourId, startDate, tourState);
		GetNextDatePeriod(periodicity, ref startDate);
	}
}

/// <summary>
/// Сохранить новый тур
/// </summary>
/// <param name="tourId">Id турпредложения</param>
/// <param name="startDate">Дата начала тура</param>
/// <param name="tourState">Справочнео поле "Состояние тура"</param>
public virtual void SaveNewTour(Guid tourId, DateTime startDate, Guid tourState)
{
	var newTourScheme = UserConnection.EntitySchemaManager.GetInstanceByName("UsrTravelTours");
	var newTour = newTourScheme.CreateEntity(UserConnection);

    newTour.SetColumnValue("Id", Guid.NewGuid());
    newTour.SetColumnValue("UsrPrice", 500);
    newTour.SetColumnValue("UsrTouristCount", 10);
    newTour.SetColumnValue("UsrTourStateId", tourState);
    newTour.SetColumnValue("UsrStartDate", startDate);
    newTour.SetColumnValue("UsrTravelTourId", tourId);
    newTour.Save();	
}

/// <summary>
/// Получить следующую дату начала тура
/// </summary>
/// <param name="periodicity">Справочное поле "Периодичность"</param>
/// <param name="date">Дата начала</param>
public virtual void GetNextDatePeriod(Guid periodicity, ref DateTime date)
{

  if (periodicity == UsrTravelTourConstants.Periodicity.Everyday)
   {
      date = date.AddDays(1);
   }
  else if (periodicity == UsrTravelTourConstants.Periodicity.Everyweek)
   {
     date = date.AddDays(1);
   }
  else if (periodicity == UsrTravelTourConstants.Periodicity.EveryMonth)
   {
       date = date.AddMonths(1);
   }	
}
